import React from "react";
import { Route, Routes } from "react-router-dom";
import TittlePage from "./components/TittlePage";
import "./style/App.css";

function App() {
  return (
    <Routes>
      <Route path="" />
      <TittlePage />
    </Routes>
  );
}

export default App;
